import ex1 from "./ex1_react/ex1";

import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";

function App() {
  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/ex1">ex1</Link>
            </li>
          </ul>
        </nav>

        <Routes>
          <Route path="/ex1" element={<ex1 />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
